
using System;
using System.IO;
using System.Windows.Forms;
using iDataIrisAxLib;



namespace IRIS_IDataMain.Controllers
{
	internal class IrisMethods
	{

		private readonly iDataIrisAxLib.IiDataIris _iDataIris = new iDataIrisClass();

		//byte[] g_ProcessedImageBytes;
		//      int g_ProcessedImageWidth;
		//      int ProcessedImageHeight;
		public int checkQulity(string imageBase64String)
		{
			byte[] imageBytes = Convert.FromBase64String(imageBase64String);

			object tmpImageLift;

			int width = 640;
			int height = 480;


			_iDataIris.BmpToRaw(imageBytes, imageBytes.Length, out tmpImageLift, out width, out height);

			imageBytes = tmpImageLift as byte[];


			int iResult;
			int quality;


			IrisImageQualityInfo irisImageQualityInfo;
			iResult = _iDataIris.GetImageQuality(Constants.IRIS_IMAGE_RECT, imageBytes, width, height, out quality,
									   out irisImageQualityInfo);

			Console.WriteLine(@"Quality Score Lift: " + quality);

			return quality;

		}

		public bool VerifyMatchesImageSIRIS(string EyeFromSytem, string EyeFromDevice)
		{

            try
            {

				byte[] imageBytesProble = Convert.FromBase64String("");
				byte[] imageBytesGellery = Convert.FromBase64String(EyeFromSytem); //Convert.FromBase64String("");
				byte[] imageBytesProble2_RIght = Convert.FromBase64String(EyeFromDevice); //Convert.FromBase64String("");
				byte[] imageBytesProble3_RIght = Convert.FromBase64String("");



				int iResult = 0;
				int galleryImageWidth;
				int galleryImageHeight;


				byte[] rawGalleryImage = ImageHelper.ImageToRaw8BitByteArray(ImageHelper.BmpToImage(imageBytesGellery), out galleryImageWidth,
																			 out galleryImageHeight);
				int probeImageHeight;
				int probeImageWidth;
				byte[] rawProbeImage = ImageHelper.ImageToRaw8BitByteArray(ImageHelper.BmpToImage(imageBytesProble2_RIght), out probeImageWidth,
																		   out probeImageHeight);


				object probeIrisCode;
				ImageInfo probeImageInfo;
				object probeProcessedImage;
				int probeImageQuality = 0;


				iResult = _iDataIris.CreateIrisCode(Constants.IRIS_IMAGE_RECT, rawProbeImage, probeImageWidth,
												   probeImageHeight, out probeIrisCode, out probeProcessedImage,
												   out probeImageQuality, out probeImageInfo);
				if (iResult != 0)
				{
					if (iResult == Constants.IAIRIS_LICENCE_EXPIRED)
						MessageBox.Show(@"License expired!", Constants.Title, MessageBoxButtons.OK, MessageBoxIcon.Information);
					else
						Console.WriteLine(string.Format(
						@"CreateIrisCode failed with error  0x{0:X}", iResult),
						Constants.Title,
						MessageBoxButtons.OK,
						MessageBoxIcon.Information);
					return false;
				}

				float hd;
				iResult = _iDataIris.VerifyByIrisImage(Constants.MATCHING_MODE_STANDARD, 100, rawGalleryImage, galleryImageWidth, galleryImageHeight, probeIrisCode,
													 0.32f, out hd);
				if (iResult != 0 && iResult != Constants.IAIRIS_NOT_MATCHED)
				{
					if (iResult == Constants.IAIRIS_LICENCE_EXPIRED)
						MessageBox.Show(@"License expired!", Constants.Title, MessageBoxButtons.OK, MessageBoxIcon.Information);
					else
						Console.WriteLine(string.Format(
						@"VerifyIrisImage failed with error  0x{0:X}", iResult),
						Constants.Title,
						MessageBoxButtons.OK,
						MessageBoxIcon.Information);
					return false;
				}



				if (iResult == Constants.IAIRIS_NOT_MATCHED)
				{
					Console.WriteLine(@"VERIFY:  FAILED");
					return false;
				}
				else
				{

					Console.WriteLine(@"Hamming Distance:  " + hd.ToString("0.00"));
					Console.WriteLine(@"VERIFY:  SUCCESSFUL)");
					return true;
				}

			}
            catch (Exception ex)
            {

            }
			return true;
		}
	}
}